import { Redirect } from "react-router-dom";
import { useHistory } from "react-router-dom";

const Lastpage = () => {
    const history = useHistory();
    function homePage(e){
        e.preventDefault()
        history.push("/");
    }

    return (
        <div>
            <navbar>
                <button onClick={homePage}>Logout</button>
            </navbar>
            <h1>Psych You thought</h1>
        </div>
    )
}

export default Lastpage
